import React from "react";
import './home.css'
import 'bootstrap/dist/css/bootstrap.css';
function Home() {
    return ( 
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
            <div className="container">
            <a href="/" className="navbar-brand" >d</a>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse"  data-bs-target ="#Mynavbar"
            aria-controls="Mynavbar" aria-label="Toggle navigation" aria-expanded="false">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="Mynavbar"> 
            <ul className="navbar-nav ml-auto">
                <li className="nav-item"><a href="/" className="nav-link">add</a></li>
                <li className="nav-item"><a href="/" className="nav-link">logo</a></li>
            </ul>
            </div>
            </div>
            </nav>
        </div>
     );
}

export default Home;
